        <Image 
          src="D:\Users\lynnlam\Desktop\bootstraptest\bootstraptest-react-page\public\logo\ia_logo.png"
          fluid>
        </Image>
        </Col>
        </Row>
        </Container>
        </main>
    </div>
  );
}

export default App;
